import React, { Component } from "react";
import EmployeeDataService from "../services/employee.service";
import '../css/main.css';
export default class AddHr extends Component {

  newEmployee() {
    this.setState({
      id: null,
      UserName: "",
      Password: "",
      //published: false,

      submitted: false
    });
  }
  render() {
    return (      
        <div>
            <link
                rel="stylesheet"
                href="https://cdn.jsdelivr.net/npm/bootstrap@5.0.2/dist/css/bootstrap.min.css"
                integrity="sha384-EVSTQN3/azprG1Anm3QDgpJLIm9Nao0Yz1ztcQTwFspd3yD65VohhpuuCOmLASjC"
                crossorigin="anonymous"
            />
            {/* Main Content */}
            <div className="search" >
                <input class="prop" type="text" name="username" id="username" placeholder="Username"></input>
                <input class="prop" type="password" name="password" id="password" placeholder="password"></input>
                <input class="prop" type="domain" name="domain" id="domain" placeholder="Domain"></input>
                <input class="prop btnsubmit" type="submit" value="Add"></input>
            </div>
            
        </div>
        
    )

  }
}
